"title": "Toys from the 80s!",
"announcement": "Remember all the awesome toys you played with in the 80s? I love finding old toys in good condition. I find them at thrift stores, garage sales, and wherever else they might turn up. Then I get to work cleaning them up and restoring them as best I can. That means when you buy them from me they&#39;re already cleaned up and ready to be enjoyed. So whether you&#39;re a collector, a customizer, or someone who wants to introduce your kids to the toys you loved, you&#39;ll find something here that brings you back.",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": null,
"sale_message": "Thanks for your purchase! I am happy to reunite people with toys that bring back childhood memories, and to find new homes for these awesome toys.  My goal is for you to be 100% satisfied with your purchase. If there are any concerns, please email me at ellies80s@yahoo.com so we can work something out! \r\n\r\nThanks again, and enjoy!\r\nEllen",
"digital_sale_message": null,
