"accepts_custom_requests": false,
"policy_welcome": "As someone who grew up in the &#39;80s, I love finding awesome vintage toys in good condition. Items vary in quality, from custom bait to collectible. I do my best to describe each item thoroughly, including any flaws, but feel free to message me with questions before making a purchase. \r\n\r\nItems come from a smoke-free home. I have pets, and I do keep them far away from my items. However, it&#39;s not impossible that a stray cat hair finds its way onto an item. Though I always try to give them a final once-over before sending, please let me know if pet allergies are a concern so I can be extra careful!",
"policy_payment": null,
"policy_shipping": "All items will be shipped via USPS. I add tracking to US packages - it adds a bit to shipping charges but it helps to know where it is and when it&#39;ll arrive! Shipping insurance provided upon request - please let me know at checkout if you want it insured. I try my best to estimate what shipping costs will be, but I&#39;ll gladly refund shipping overages of $2 or more.  If you want something to arrive faster, I&#39;m happy to upgrade to Priority Mail, just message me so we can work out the details.\r\n\r\nIf you&#39;re interested in multiple items and want to save on shipping beyond the combined rates, convo me and I&#39;ll see if a flat rate box or something like that can be worked out.  ",
