"title": "1980s Scooby-Doo FRONT Of Gum Machine Sticker Sheet UNUSED",
"description": "1980s Scooby-Doo FRONT Of Gum Machine Sticker Sheet UNUSED\r\n\r\nEstimated value: $10.00 each\r\n\r\nThese came from a Columbus gum machine company that has been out of business for several years.  This is one of those unused sticker sheets that slid into the front display of the gum machine / toy machine to show you the possible stickers you could get for $0.25 out of one of the many capsules inside.\r\n\r\nThis design was originally used in 1976 in gum machines and the stickers were 10 cents each.  The inner sheet was smaller back then.  This is from the 1980s and was series 2 of the designs and single stickers sold for 25 cents each.\r\n\r\nThis sheet can still be used and the stickers will still peel off.\r\n\r\nVery strange green tint on the faces even though these have never been used or displayed.  I have been told that they were green tint so that dealers who received the front panel of stickers did not cut them and try to sell them in the machine.  Novel idea and it also makes these pretty rare for the classic gum machine collector.  One of these sheets were made for every 1,000 regular stickers that were made to be placed in those plastic capsules.\r\n\r\nSheet measures roughly 5” x 7”.  \r\n\r\nLet me know if you have any questions.\r\n\r\nNeed more than one sheet of these and want a great discount?  Message me and I can create a special listing for you and sell for the following prices (shipping is additional):\r\n\r\n1 sheet $5.00 each = $5.00\r\n2 sheets $4.00 each = $8.00\r\n4 sheets $3.50 each = $14.00\r\n8 sheets $3.00 each = $24.00\r\n\r\nJust let me know!!!",
