"sale_message": "Wow! Thank you for your business!  It is appreciated.  As per our policy, we ship within 7 calendar days of payment clearing.  Most ship within three business days but some take the full 7 days.  Packages shipped outside the United States may have customs charges and are determined by the receiver&#39;s country&#39;s laws.  All customs and duties are the responsibility of the buyer.  \r\n\r\nWe hope you enjoy the art of Therp Sajik or one of his very cool vintage novelty items!  Come back and see us when you can and  have a great day!",
