"policy_welcome": "We believe in going our own way.  Therp Sajik is an artist who also is a business man.  Rarely do these two personalities mesh but in his case it does!  We hope you find you are brought back to days gone-by and you find a little happiness EVERY day!\r\n\r\n*WARNING* Our collectible items are for adults and may not be appropriate for children.  Some items contain materials that may be harmful to people under the age of 18.  Do not allow children to play with certain items without first investigating the contents of the item.  Contact us with any questions and we will be glad to provide assistance.  Most items are lead and nickel free.\r\n\r\n99% of our items, especially toy rings, are designed to be placed in a display and not necessarily worn.  The only exception would be items in Vintage Jewelry.  Please do not purchase toy rings to be worn unless you do so at your own risk.",
